    <React.Fragment>
      {this.state.people.map((person, index) => (
        <p>
          Hello, {person.name} from {person.country}!
        </p>
      ))}

      <div className="col-3">
        <iframe
          width="560"
          height="315"
          src="https://www.youtube.com/embed/AsgDfoLF3WU"
          frameBorder="0"
          allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
          allowFullScreen
        ></iframe>
      </div>
    </React.Fragment>
  );
};

const Media = () => (
  <div>
